import React from 'react';
import banner from '../images/jacques-bopp-Hh18POSx5qk-unsplash.jpg';

const Home = () => {
  return (
    <div className="container-fluid">

    <div>
      <img src={banner} alt="" width="50%"/>
    </div>
    </div>
  )
}

export default Home
